import logo from './logo.svg';

function App() {
  return (
    <div className="App" style={{ display: "flex", justifyContent: "center" }}>
      <Notes />
    </div>
  );
}

function Notes() {
  const backendData = [
    { Name: "Decyl Glucoside", Ranking: "1" },
    { Name: "", Ranking: "1" },
    { Name: "", Ranking: "1" },
    { Name: "", Ranking: "1" },
    { Name: "", Ranking: "1" },
    { Name: "", Ranking: "1" },
    { Name: "", Ranking: "1" },
  ]

  const noteRootStyle = {
    border: "2px #0af solid",
    borderRadius: 9,
    margin: 20,
    backgroundColor: "#efefef",
    padding: 6
  };

  return (
    <div style={{ width: 400 }}>
      {backendData.map(ele => 
        <div style={noteRootStyle}>
          <h3>{ele.Name}</h3>
          <p>{ele.Ranking}</p>
        </div>
      )}
    </div>
  )
}

export default App;
